{% extends 'base.html.twig' %}

{% block title %}Editar Perfil{% endblock %}
{% block stylesheets %}
    {{ parent() }}
        <link href=\"../../css/userData.css\"rel=\"stylesheet\"/>
        <link href=\"../../css/navBar.css\"rel=\"stylesheet\"/>
{% endblock %}

{% block body %}

    <h1>Editar Perfil</h1>

    <div class=\"container\">
   <div class=\"formulario col-md-12\">
       {{ form_start(form) }}
        {# {{ form_widget(form) }} #}

        <div>
            <label><b>{{ form_row(form.name, {\"label\": \"Nombre\"})}}</b></label>
        </div>
        <div>
            <label><b>{{ form_row(form.firstname, {\"label\": \"Primer Apellido\"})}}</b></label>
        </div>
        <div>
            <label><b> {{ form_row(form.lastname, {\"label\": \"Segundo Apellido\"})}}</b></label>
        </div>

        <div>
            <label><b>{{ form_row(form.dni, {\"label\": \"DNI\"})}}</b></label>
        </div>

        <div>
           <label><b>{{ form_row(form.birthdate, {\"label\": \"Fecha de Nacimiento\"})}}</b></label>
        </div>
        <div>
          <label><b>{{ form_row(form.genre, {\"label\": \"Género\"})}}</b></label>
        </div>
        
        <div>
           <label><b>{{ form_row(form.city, {\"label\": \"Ciudad\"})}}</b></label>
        </div>
        
        <div>
           <label><b>{{ form_row(form.cp, {\"label\": \"Código postal\"})}}</b></label>
        </div>
        <div>
           <label><b>{{ form_row(form.phoneNumber, {\"label\": \"Telefono móvil\"})}}</b></label>
        </div>
    
         <div>
             <label><b>Email</b><input type=\"text\" name=\"email\" class=\"form-control\"placeholder=\"{{user.email}}\"></label>
        </div>
        
        
        <button class=\"btn\">{{ button_label|default('Actualizar') }}</button>
    {{ form_end(form) }}
        
    </div>
</div>
{% endblock %}
", "user_data/edit.html.twig", "C:\\Users\\laura\\campers\\templates\\user_data\\edit.html.twig");
